Faced with an anxiety crisis, the brain releases cortisol and adrenaline, which makes breathing panting. Therefore, there is a strong shortness of breath and an adrenaline discharge and this causes your heart to accelerate; The chest begins to hurt and squeeze. This mixture of sensations makes the legs and arms agitated and the person may have the feeling that they are dying.

In addition, there are other symptoms that arise, which are:

Accelerated speech;
Sensation of tremor;
Willingness to bite the nails;
Muscle tension;
Dizziness;
Dry mouth,
Hypersensitivity on the taste;
Nervousness;
Constant fear;
Among other symptoms.

Do you feel at least 3 of these symptoms?
Seek psychological help.

